sourcesContent:
import styled from "styled-components";

export const Item = styled.div`
    padding-top: 5px;
    padding-bottom: 5px;
    width: 85vw;
    margin: 0 auto;
    grid-template-columns: 1fr 1fr 1fr;
    row-gap: 15px;
    column-gap: 25px;
    display: grid;
    align-items: center;
    justify-content: center;
`;
